import './App.css';
import Navbar from './Navbar';
import MainContent from './mainContent';

function App() {
  return (
    <div>

    <div>
        <header>
            <Navbar />

        </header>           
      </div>

      <div>
        <main>
          <MainContent />
        </main>
      </div>

